import { GET_USER_CRM } from "./valiable.reducer";

const initialState = {
    dataUser: {}
}

export const userReducer = (state = initialState, action) => {
    switch (action.type) {
        case GET_USER_CRM: {
            state.dataUser = action.datas;
            return { ...state }
        }

        default:
            return state
    }
}
